import React from 'react';
import './App.css';
import First from './First/First'
function App() {
  return (
    <div className="App">
      <First name="Md.Rohan" email="rohan@gmail.com" address="dhanmondi" />
      <First name="Md.Mehedi" email="mehedi@gmail.com" address="Lalmohan" />
      <First name="Md.Rocky" email="rocky@gmail.com" address="bogra" />
      <First name="Md.Tanzil" email="tanzil@gmail.com" address="Narayn" />
    </div>
  );
}

export default App;
